import Layout from '../components/Layout';
import Link from 'next/link';

const Index = (props) => (
  <Layout>
    <h1>Shows</h1>
    <ul>
      {props.shows.map(({ show }) => (
        <li key={show.id}>
          <Link as={`/post/${show.id}`} href={`/post?id=${show.id}`}>
            <h2>{show.name}</h2>
          </Link>
        </li>
      ))}
    </ul>
  </Layout>
)
